## 题目描述

输入一个整数数组，实现一个函数来调整该数组中数字的顺序，使得所有的奇数位于数组的前半部分，所有的偶数位于数组的后半部分，并保证奇数和奇数，偶数和偶数之间的相对位置不变。

## 解法

### 解法一

解法一的思路是，对于每个数字，先把它放到数组的前面，然后再把它放到数组的后面。

```java
/**
 * @param nums 数组
 * @return 调整后的数组
 */
public int[] exchange(int[] nums) {
    int i = 0, j = nums.length - 1;
    while (i < j) {
        while (i < j && nums[i] % 2 == 1) {
            i++;
        }
        while (i < j && nums[j] % 2 == 0) {
            j--;
        }
        if (i < j) {
            int temp = nums[i];
            nums[i] = nums[j];
            nums[j] = temp;
        }
    }
    return nums;
}
```

### 解法二

解法二的思路是，对于每个数字，先把它放到数组的前面，然后再把它放到数组的后面。

```java
