## 题目描述

输入一个整数数组，判断该数组是不是某二叉搜索树的后序遍历的结果。如果是则输出Yes,否则输出No。假设输入的数组的任意两个数字都互不相同。

## 解法一

[LeetCode中文](https://leetcode-cn.com/problems/verify-preorder-sequence-in-binary-search-tree/)、[LeetCode英文](https://leetcode.com/problems/verify-preorder-sequence-in-binary-search-tree/)

### 方法一

首先判断数组是不是某二叉搜索树的后序遍历的结果，如果是则输出Yes，否则输出No。

```java
/**
 * @param preorder 后序遍历数组
 * @return 是否是二叉搜索树的后序遍历结果
 */
public boolean verifyPreorder(int[] preorder) {
    if (preorder == null || preorder.length == 0) {
        return false;
    }
    return verify(preorder, 0, preorder.length - 1);
}

/**
 * @param preorder 后序遍历数组
 * @param start 开始遍历的位置
 * @param end   结束遍历的位置
 * @return 是否是二叉搜索树的后序遍历结果
 */
private boolean verify(int[] preorder, int start, int end) {
    if (start > end) {
        return true;
    }
    int root = preorder[start];
    int i = start + 1;
    while (i <= end && preorder[i] < root) {
        i++;
    }
    if (i > end) {
        return false;
    }
    return verify(preorder, start + 1, i - 1) && verify(preorder, i, end);
}
```

