## 题目描述

给定一个数组，返回其中最大的和。

**示例 1:**

```
输入: [1, -2, 3, -2]
输出: 3
```

**示例 2:**

```
输入: [-2, -1]
输出: -1
```

**示例 3:**

```
输入: [-2, 1, -1]
输出: 2
```

**说明:**

- 输入数组的长度不超过 1000。
- 输入数组中的所有值都在 -231 到 231 之间。

## 解法一

使用动态规划，设置两个变量，`dp[i]` 表示数组中从 `0` 到 `i` 的最大和，`dp[i]` 初始值为 `i` 的值，`dp[i]` 的值为 `dp[i - 1] + i`。

```java
public int maxSum(int[] nums) {
    int n = nums.length;
    int[] dp = new int[n];
    dp[0] = nums[0];
    for (int i = 1; i < n; i++) {
        dp[i] = Math.max(dp[i - 1] + nums[i], nums[i]);
    }
    return dp[n - 1];
}
```

## 解法二

使用二分查找，设置两个变量，`dp[i]` 表示数组中从 `0` 到 `i` 的最大和，`dp[i]` 初始值为 `i` 的值，`dp[i]` 的值为 `dp[i - 1] + i`。

```java
public int maxSum(int[] nums) {
    int n = nums.length;
    int[] dp = new int[n];
    dp[0] = nums[0];
    for (int i = 1; i < n; i++) {
        int left = 0;
        int right = i;
        while (left < right) {
            int mid = left + (right - left) / 2;
            if (dp[mid] + mid > nums[i]) {
                right = mid;
            } else {
                left = mid + 1;
            }
        }
        dp[i] = dp[i - 1] + i;
    }
    return dp[n - 1];
}
```

