public double median(List<Integer> l) {
    int n = l.size();
    int left = 0, right = n - 1;
    while (left <= right) {
        int mid = left + (right - left) / 2;
        if (mid == 0 || l.get(mid - 1) >= l.get(mid)) {
            break;
        }
        if (l.get(mid) < l.get(mid - 1)) {
            right = mid - 1;
        } else {
            left = mid + 1;
        }
