        if (mid == n - 1 || l.get(mid) >= l.get(mid + 1)) {
            break;
        }
        if (l.get(mid) < l.get(mid + 1)) {
            leftMid = mid + 1;
        } else {
            rightMid = mid - 1;
        }
    }
    return (double) (leftMid + rightMid) / 2;
}
