public int[] splitArray(int[] nums, int m) {
    int[] result = new int[m];
    int left = 0;
    int right = 0;
    for (int i = 0; i < m; i++) {
        right += nums[i];
    }
    while (left < right) {
        int mid = left + (right - left) / 2;
        int count = 0;
        for (int i = 0; i < m; i++) {
            count += Math.min(nums[i], mid);
        }
        if (count < m) {
            left = mid + 1;
        } else {
            right = mid;
        }
    }
    for (int i = 0; i < m; i++) {
        result[i] = left;
        left += nums[i];
    }
    return result;
}
