[LeetCode中文](https://leetcode-cn.com/problems/product-of-the-last-k-digits/)、[LeetCode英文](https://leetcode.com/problems/product-of-the-last-k-digits/)

给定一个整数 n，返回 n! 结果的第 k 个最大的整数。

**示例 1：**

```
输入：n = 3
输出：3
解释：
3! = 6
6! = 24
24! = 120
120! = 720
3! 结果的第三个最大的整数是 3。
```

**示例 2：**

```
输入：n = 5
输出：120
```

**示例 3：**

```
输入：n = 1
输出：0
```

